        url = host + '?pw=' +  password + '&pkts=[' + '0'*(3-len(str(total_packet_num))) + str(total_packet_num) + ',' + '0'*(3-len(str(current_packet_num))) + str(current_packet_num) + ']' + '&mz=' + str(pkt)

        webbrowser.open(url)

